import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import ApiService from "../../service/ApiService";
import '../../style/register.css';

const LoginPage = () => {
    const [formData, setFormData] = useState({
        email: '',
        password: ''
    });

    const [message, setMessage] = useState(null);
    const [loading, setLoading] = useState(false);
    const [errors, setErrors] = useState({});
    const navigate = useNavigate();

    const validate = () => {
        const errors = {};
        if (!formData.email) errors.email = "Email is required";
        if (!formData.password) errors.password = "Password is required";
        else if (formData.password.length < 6) errors.password = "Password must be at least 6 characters long";
        return errors;
    }

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
        setErrors(validate());
    }

    const handleSubmit = async (e) => {
        e.preventDefault();
        const formErrors = validate();
        if (Object.keys(formErrors).length) {
            setErrors(formErrors);
            return;
        }
        setLoading(true);
        try {
            const response = await ApiService.loginUser(formData);
            if (response.status === 200) {
                setMessage("User Successfully Logged in");
                localStorage.setItem('token', response.token);
                localStorage.setItem('role', response.role);
                setTimeout(() => {
                    navigate("/profile");
                }, 2000);
            }
        } catch (error) {
            setMessage(error.response?.data.message || error.message || "Unable to login");
        } finally {
            setLoading(false);
        }
    }

    return (
        <div className="login-page">
            <div className="background-animation"></div>
            <div className="login-container">
                <h2>Login</h2>
                {message && <p className={`message ${message.includes("Successfully") ? "success" : "error"}`}>{message}</p>}
                <form onSubmit={handleSubmit}>
                    <div className="input-container">
                        <input
                            type="email"
                            id="email"
                            name="email"
                            value={formData.email}
                            onChange={handleChange}
                            className={`input-field ${errors.email ? 'error' : ''}`}
                            required
                        />
                        <label htmlFor="email" className={`input-label ${formData.email ? 'filled' : ''}`}>Email</label>
                        {errors.email && <p className="error-message">{errors.email}</p>}
                    </div>

                    <div className="input-container">
                        <input
                            type="password"
                            id="password"
                            name="password"
                            value={formData.password}
                            onChange={handleChange}
                            className={`input-field ${errors.password ? 'error' : ''}`}
                            required
                        />
                        <label htmlFor="password" className={`input-label ${formData.password ? 'filled' : ''}`}>Password</label>
                        {errors.password && <p className="error-message">{errors.password}</p>}
                    </div>

                    <button type="submit" disabled={loading} className="submit-button">
                        {loading ? <div className="spinner"></div> : "Login"}
                    </button>

                    <p className="register-link">
                        Don't have an account? <a href="/register">Register</a>
                    </p>
                </form>
            </div>
        </div>
    )
}

export default LoginPage;
